message:
/* Aftermath */Changed 'Frederico' to Frederick to correspond to the rest of the (English) article
Changed 'heal' to 'resolve' (referring to the situation)
Changed 'the situation Italian' (probably literally translated from Italian) to 'the situation in Italy'

/* Caucasus Campaign */Incorrectly cited that Rummel claims 600k Muslims were killed where in fact in the text, he wrote that he estimates a total of 150k between 1915-1918. 

Rummel finds the claim that Armenians killed 600,000 incredible (not credible). 

https://www.hawaii.edu/powerkills/SOD.CHAP12.HTM
